// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <h1>Nove Tilo Fitnes Klub</h1>
    </header>
  );
};

const Navigation = () => {
  return (
    <nav>
      <ul>
        <li><Link to="/">Головна Сторінка</Link></li>
        <li><Link to="/training">Про Нас</Link></li>
        <li><Link to="/schedule">Цінові Плани та Акції</Link></li>
      </ul>
    </nav>
  );
};

const WelcomeSection = () => {
  return (
    <section>
      <h2>Привітання та Запрошення</h2>
      {/* ... */}
    </section>
  );
};

const TrainingZonesSection = () => {
  return (
    <section>
      <h2>Зоны Тренувань</h2>
      {/* ... */}
    </section>
  );
};

const ScheduleSection = () => {
  return (
    <section>
      <h2 id="schedule">Розклад Роботи</h2>
      {/* ... */}
    </section>
  );
};

const Footer = () => {
  return (
    <footer>
      <p>Долучайтесь до нас:</p>
      <a href="https://www.instagram.com/" target="_blank">Instagram</a> |
      <a href="https://www.facebook.com/" target="_blank">Facebook</a> |
      <a href="mailto:info@example.com">Електронна пошта</a> |
      Телефон: +123456789
    </footer>
  );
};

const App = () => {
  return (
    <Router>
      <div>
        <Header />
        <Navigation />
        <Switch>
          <Route path="/" exact component={WelcomeSection} />
          <Route path="/training" component={TrainingZonesSection} />
          <Route path="/schedule" component={ScheduleSection} />
        </Switch>
        <Footer />
      </div>
    </Router>
  );
};

export default App;
